import React from "react";

const Main = ({ personas }) => {
  // console.log(personas);
  return (
    <>
      <main>
        {personas.map((persona) => {
          return (
            <ul>
              <li></li>
            </ul>
          );
        })}
      </main>
    </>
  );
};

export default Main;
